import random

def generate_dna_sequence(length, gc_content):
    nucleotides = ['A', 'C', 'G', 'T']
    sequence = ''

    for i in range(length):
        if random.random() < gc_content:
            nucleotide = random.choice(nucleotides[:2])
        else:
            nucleotide = random.choice(nucleotides[2:])
        sequence += nucleotide

    return sequence

def mutate_dna_sequence(sequence, mutation_rate):
    nucleotides = ['A', 'C', 'G', 'T']

    for i in range(len(sequence)):
        if random.random() < mutation_rate:
            nucleotide = random.choice(nucleotides)
            while nucleotide == sequence[i]:
                nucleotide = random.choice(nucleotides)
            sequence = sequence[:i] + nucleotide + sequence[i+1:]

    return sequence

def construct_child_dna_sequence(father_sequence, mutation_rate):
    child_sequence = mutate_dna_sequence(father_sequence, mutation_rate)
    return child_sequence

